NCY BTN RTF INSTRUCTIONS AND GND LGT ROUTINGS, ACFT\n  SHALL CTC ATC AT THE EARLIEST OPPORTUNITY AND, IF NECCESSARY, HOLD\n  PSN WHEN SAFE TO DO SO.\n\n++++++++++++++++++++++++++++++ RUNWAY ++++++++++++++++++++++++++++++\n\n&lt;b&gt;A0797/20   &lt;/b&gt;\n  DLY BTN 0300-1400\n  &lt;b&gt;RWY 13L/31R&lt;/b&gt; &lt;b&gt;CLSD&lt;/b&gt; DUE &lt;b&gt;WIP&lt;/b&gt;.\n&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;&lt;!--BKMK///Company NOTAM///0--&gt;&lt;b&gt;[ Company NOTAM ]\n--------------------------------------------------------------------&lt;/b&gt;\n&lt;b&gt;==========\nCREW ALERT\n==========&lt;/b&gt;\n\n&lt;b&gt;SB007/14   &lt;/b&gt;\n  SUBJECT: AUTO COST INDEXES\n  &lt;t&gt;WHEN PLANNING A COST INDEX, 2 OPTIONS ARE AVAILABLE. PILOTS MAY\n  EITHER SELECT A SPECIFIC COST INDEX NUMBER FROM THE LIST, OR THEY\n  MAY SELECT \"AUTO\". WHEN PLANNING AN \"AUTO\" COST INDEX, THE SYSTEM\n  WILL REFERENCE THE \"TIME ENROUTE\" OPTION AND ATTEMPT TO CHOOSE A\n  COST INDEX WHICH CLOSELY MATCHES THIS VALUE. NOTE THAT THE \"TIME\n  ENROUTE\" OPTION IS MEANT AS A GATE TO GATE TIME (AS INDICATED ON\n  AN AIRLINE'S FLIGHT SCHEDULE, FOR EXAMPLE). IF A \"TIME ENROUTE\" OF\n  2:30 IS SELECTED, THE SYSTEM WILL SUBTRACT THE TAXI TIMES FROM\n  THIS VALUE TO DETERMINE THE SCHEDULED AIR TIME. IT WILL THEN\n  DETERMINE AND USE THE COST INDEX WHICH MATCHES THIS AIR TIME.&lt;/t&gt;\n\n&lt;b&gt;SB003/13   &lt;/b&gt;\n  SUBJECT: FLIGHT RELEASE UNITS\n  &lt;t&gt;ALL FLIGHT CREW: PLEASE PAY SPECIAL ATTENTION TO THE UNITS\n  SELECTION WHEN GENERATING A FLIGHT PLAN. FAILURE TO IDENTIFY THE\n  CORRECT UNITS WHEN REFUELING PRIOR TO FLIGHT CAN RESULT IN\n  DEPARTING WITH INSUFFICIENT FUEL AND/OR AN ERRONEOUS PAYLOAD.&lt;/t&gt;\n\n&lt;b&gt;=============\nCREW BULLETIN\n=============&lt;/b&gt;\n\nNIL\n\n\n==================== END OF LIDO-NOTAM-BULLETIN ====================&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;Route\n&lt;a class=\"ofpmaplink\" href=\"http://www.simbrief.com/o