b&gt;TWY B&lt;/b&gt; BTN &lt;b&gt;TWY B9&lt;/b&gt; AND &lt;b&gt;TWY G&lt;/b&gt; &lt;b&gt;CLSD&lt;/b&gt; DUE &lt;b&gt;WIP&lt;/b&gt;.\n&lt;b&gt;A0401/20   &lt;/b&gt;\n  DLY BTN 0200-1600\n  OBST CRAWLER CRANE OPR IN YAS ISLAND WI RADIUS 56M AT PSN\n  242742.38N 0543602.65E\n  F) SFC  G) 338FT AGL\n&lt;b&gt;A0408/20   &lt;/b&gt;\n  DLY BTN 0130-0300 AND 1430-1530\n  IN ORDER TO MNTN ATC FAMILIARITY WITH THE NEW AIRFIELD LGT SYSTEM,\n  ATC WILL UTILISE THE SYSTEM IN THE SOUTH AIRFIELD DURING THESE\n  TIMES IN &lt;b&gt;CAT&lt;/b&gt; I COND. ATC WILL CONT TO ISSUE STANDARD &lt;b&gt;TWY&lt;/b&gt; ROUTINGS\n  BY RTF, AND WILL SUPPLEMENT THESE BY PROVIDING GREEN CL LIGHT\n  ROUTINGS. INSTRUCTIONS ISSUED BY RTF TAKE PRECEDENCE, AND\n  THEREFORE SHOULD THERE BE ANY DOUBT, OR IF IT IS BELIEVED THERE IS\n  A DISCREPANCY BTN RTF INSTRUCTIONS AND GND LGT ROUTINGS, ACFT\n  SHALL CTC ATC AT THE EARLIEST OPPORTUNITY AND, IF NECCESSARY, HOLD\n  PSN WHEN SAFE TO DO SO.\n\n++++++++++++++++++++++++++++++ RUNWAY ++++++++++++++++++++++++++++++\n\n&lt;b&gt;A0797/20   &lt;/b&gt;\n  DLY BTN 0300-1400\n  &lt;b&gt;RWY 13L/31R&lt;/b&gt; &lt;b&gt;CLSD&lt;/b&gt; DUE &lt;b&gt;WIP&lt;/b&gt;.\n&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;&lt;!--BKMK///Company NOTAM///0--&gt;&lt;b&gt;[ Company NOTAM ]\n--------------------------------------------------------------------&lt;/b&gt;\n&lt;b&gt;==========\nCREW ALERT\n==========&lt;/b&gt;\n\n&lt;b&gt;SB007/14   &lt;/b&gt;\n  SUBJECT: AUTO COST INDEXES\n  &lt;t&gt;WHEN PLANNING A COST INDEX, 2 OPTIONS ARE AVAILABLE. PILOTS MAY\n  EITHER SELECT A SPECIFIC COST INDEX NUMBER FROM THE LIST, OR THEY\n  MAY SELECT \"AUTO\". WHEN PLANNING AN \"AUTO\" COST INDEX, THE SYSTEM\n  WILL REFERENCE THE \"TIME ENROUTE\" OPTION AND ATTEMPT TO CHOOSE A\n  COST INDEX WHICH CLOSELY MATCHES THIS VALUE. NOTE THAT THE \"TIME\n  ENROUTE\" OPTION IS MEANT AS A GATE TO GATE TIME (AS INDICATED ON\n  AN AIRLINE'S FLIGHT SCHEDULE, FOR EXAMPLE). IF A \"TIME ENROUTE\" OF\n  2:30 IS SELECTED, THE SYSTEM WILL SUBTRACT THE TAXI TIMES FROM\n  THIS VALUE TO DETERMINE THE SCHEDULED AIR TIME. IT WILL THEN\n  DETERMINE AND USE THE COST INDEX WHICH MATCHES THIS AIR TIME.&lt;/t&gt;\n\n&lt;b&gt;SB003/13   &lt;/b&gt;\n  SUBJECT: FLIGHT RELEASE UNITS\n  &lt;t&gt;ALL FLIGHT CREW: PLEASE PAY SPECIAL ATTENTION TO THE UNITS\n  SELECTION WHEN GENERATING A FLIGHT PLAN. FAILURE TO IDENTIFY THE\n  CORRECT UNITS WHEN REFUELING PRIOR TO FLIGHT CAN RESULT IN\n  DEPARTING WITH INSUFFICIENT FUEL AND/OR AN ERRONEOUS PAYLOAD.&lt;/t&gt;\n\n&lt;b&gt;=============\nCREW BULLETIN\n=============&lt;/b&gt;\n\nNIL\n\n\n==================== END OF LIDO-NOTAM-BULLETIN ====================&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;Route\n&lt;a class=\"ofpmaplink\" href=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_ROUTE.gif\" target=\"_blank\"&gt;&lt;img src=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_ROUTE.gif\" alt=\"Image no longer available, please regenerate the flightplan.\" width=\"600px\"&gt;&lt;/a&gt;&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;SigWx 1 of 1\n&lt;a class=\"ofpmaplink\" href=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_SIGWX06.gif\" target=\"_blank\"&gt;&lt;img src=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_SIGWX06.gif\" alt=\"Image no longer available, please regenerate the flightplan.\" width=\"600px\"&gt;&lt;/a&gt;&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;UAD 1 of 3\n&lt;a class=\"ofpmaplink\" href=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_WINDS14000.gif\" target=\"_blank\"&gt;&lt;img src=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_WINDS14000.gif\" alt=\"Image no longer available, please regenerate the flightplan.\" width=\"600px\"&gt;&lt;/a&gt;&lt;h2 style=\"page-break-after: always;\"&gt; &lt;/h2&gt;UAD 2 of 3\n&lt;a class=\"ofpmaplink\" href=\"http://www.simbrief.com/ofp/uads/OMDBOMAA_1585669694_WINDS18000.gif\" target=\"_blank\"&gt;&l